def get_corners(H , video_frame  ,  book_img =  book_img ):
  book_height, book_width = book_img.shape[:2]
  book_corners = np.array([
      [0, 0],
      [book_width - 1, 0],
      [book_width - 1, book_height - 1],
      [0, book_height - 1]
  ], dtype=np.float32)

  mapped_corners = map_points(H, book_corners)
  return mapped_corners

